n s\\u1ebd b\\u1ecb phong t\\u1ecfa.\\r\\n\\r\\nTh\\u00f4ng b\\u00e1o phong t\\u1ecfa \\u0111\\u01b0\\u1ee3c \\u0111\\u01b0a ra r\\u1ea1ng s\\u00e1ng 23\\/1, trong b\\u1ed1i c\\u1ea3nh gi\\u1edbi ch\\u1ee9c V\\u0169 H\\u00e1n \\u0111ang n\\u1ed7 l\\u1ef1c ki\\u1ec3m so\\u00e1t m\\u1ed9t d\\u1ecbch b\\u1ec7nh l\\u1ea1 \\u0111ang b\\u00f9ng ph\\u00e1t m\\u1ea1nh m\\u1ebd t\\u1ea1i th\\u00e0nh ph\\u1ed1 11 tri\\u1ec7u d\\u00e2n. D\\u1ecbch b\\u1ec7nh gi\\u1ed1ng nh\\u01b0 vi\\u00eam ph\\u1ed5i n\\u00e0y nhi\\u1ec1u tu\\u1ea7n sau \\u0111\\u01b0\\u1ee3c \\u0111\\u1eb7t t\\u00ean ch\\u00ednh th\\u1ee9c l\\u00e0 Covid-19.\\r\\n\\r\\n\\\"Suy ngh\\u0129 \\u0111\\u1ea7u ti\\u00ean c\\u1ee7a t\\u00f4i l\\u00e0 sao \\u0111i\\u1ec1u n\\u00e0y c\\u00f3 th\\u1ec3 x\\u1ea3y ra? B\\u1ea1n phong t\\u1ecfa c\\u1ea3 m\\u1ed9t th\\u00e0nh ph\\u1ed1 b\\u1eb1ng c\\u00e1ch n\\u00e0o c\\u01a1 ch\\u1ee9?\\\", Joshua Koh chia s\\u1ebb v\\u1edbi Channel News Asia t\\u1ea1i nh\\u00e0 ri\\u00eang c\\u1ee7a anh \\u1edf V\\u0169 H\\u00e1n, th\\u1ee7 ph\\u1ee7 t\\u1ec9nh H\\u1ed3 B\\u1eafc, Trung Qu\\u1ed1c. \\\"Nhi\\u1ec1u c\\u00e2u h\\u1ecfi b\\u1eadt l\\u00ean nh\\u01b0 chuy\\u1ec7n g\\u00ec s\\u1ebd x\\u1ea3y ra ti\\u1ebfp theo? Li\\u1ec7u nh\\u1eefng ng\\u01b0\\u1eddi kh\\u00e1c c\\u00f3 an to\\u00e0n kh\\u00f4ng?\\\".\",\"_token\":\"ZSQ4xYPcAri5MYjdS1eLCVJd2XPa96yxGJz7Bqsx\",\"_method\":\"PUT\",\"_previous_\":\"http:\\/\\/truyenthanh.org.vn:8888\\/admin\\/docs\"}','2021-01-11 09:57:57','2021-01-11 09:57:57'),(7810,1,'admin/docs','GET','27.79.229.175','[]','2021-01-11 09:58:09','2021-01-11 09:58:09'),(7811,1,'admin/docs/6/edit','GET','27.79.229.175','{\"_pjax\":\"#pjax-container\"}','2021-01-11 09:58:25','2021-01-11 09:58:25'),(7812,1,'admin/docs/6','PUT','27.79.229.175','{\"name\":\"nakaurawa\",\"content\":\"Futsalplanet \\u0111\\u00e3 \\u0111\\u1ec1 c\\u1eed HLV Ph\\u1ea1m Minh Giang c\\u1ee7a Th\\u00e1i S\\u01a1n Nam v\\u00e0o danh s\\u00e1ch 10 HLV xu\\u1ea5t s\\u1eafc nh\\u1ea5t th\\u1eb