-20 07:16:02'),(9814,1,'admin/docs/13','PUT','27.69.14.125','{\"name\":\"ngoaihanganh\",\"content\":\"Man Utd v\\u00e0 nhi\\u1ec1u \\u0111\\u1ed9i b\\u00f3ng kh\\u00e1c \\u0111ang ho\\u1ea1t \\u0111\\u1ed9ng kh\\u00e1 tr\\u1ea7m l\\u1eafng trong k\\u1ef3 chuy\\u1ec3n nh\\u01b0\\u1ee3ng m\\u00f9a \\u0110\\u00f4ng.\\r\\n\\r\\nTr\\u00e1i ng\\u01b0\\u1ee3c v\\u1edbi k\\u1ef3 chuy\\u1ec3n nh\\u01b0\\u1ee3ng m\\u00f9a H\\u00e8, k\\u1ef3 chuy\\u1ec3n nh\\u01b0\\u1ee3ng th\\u00e1ng Gi\\u00eang \\u0111ang di\\u1ec5n ra kh\\u00f4ng \\u0111\\u01b0\\u1ee3c s\\u00f4i n\\u1ed5i. H\\u1ea7u h\\u1ebft c\\u00e1c CLB \\u0111\\u1ec1u t\\u00ecm c\\u00e1ch b\\u00e1n \\u0111i c\\u00e1c c\\u1ea7u th\\u1ee7 n\\u1eb1m ngo\\u00e0i k\\u1ebf ho\\u1ea1ch.\\r\\n\\r\\nMan Utd \\u0111\\u00e3 \\u0111\\u1ea9y \\u0111i Timothy Fosu-Mensah (sang Bayer Leverkusen), v\\u00e0 \\u0111ang t\\u00ecm c\\u00e1ch thanh l\\u00fd nh\\u1eefng Jesse Lingard, Sergio Romero hay Marcos Rojo. H\\u1ecd v\\u1eeba \\u0111\\u00f3n Amad Diallo, nh\\u01b0ng th\\u1ef1c ch\\u1ea5t, \\u0111\\u00e2y l\\u00e0 c\\u00e1i t\\u00ean m\\u00e0 \\u0111\\u1ed9i ch\\u1ee7 s\\u00e2n Old Trafford \\u0111\\u00e3 \\u0111\\u1ea1t th\\u1ecfa thu\\u1eadn chi\\u00eau m\\u1ed9 t\\u1eeb m\\u00f9a H\\u00e8 2020.\\r\\n Man Utd v\\u00e0 nhi\\u1ec1u \\u0111\\u1ed9i b\\u00f3ng kh\\u00e1c \\u0111ang ho\\u1ea1t \\u0111\\u1ed9ng kh\\u00e1 tr\\u1ea7m l\\u1eafng trong k\\u1ef3 chuy\\u1ec3n nh\\u01b0\\u1ee3ng m\\u00f9a \\u0110\\u00f4ng.\\r\\n\\r\\nTr\\u00e1i ng\\u01b0\\u1ee3c v\\u1edbi k\\u1ef3 chuy\\u1ec3n nh\\u01b0\\u1ee3ng m\\u00f9a H\\u00e8, k\\u1ef3 chuy\\u1ec3n nh\\u01b0\\u1ee3ng th\\u00e1ng Gi\\u00eang \\u0111ang di\\u1ec5n ra kh\\u00f4ng \\u0111\\u01b0\\u1ee3c s\\u00f4i n\\u1ed5i. H\\u1ea7u h\\u1ebft c\\u00e1c CLB \\u0111\\u1ec1u t\\u00ecm c\\u00e1ch b\\u00e1n \\u0111i c\\u00e1c c\\u1ea7u th\\u1ee7 n\\u1eb1m ngo\\u00e0i k\\u1ebf ho\\u1ea1ch.\\r\\n\\r\\nMan Utd \\u0111\\u00e3 \\u0111\\u1ea9y \\u0111i Timothy Fosu-Mensah (sang Bayer Leverkusen), v\\u00e