\\u00e1t online v\\u0103n b\\u1ea3n\",\"content\":\"H\\u00e0 N\\u1ed9i nghi\\u00ean c\\u1ee9u t\\u1ed5 ch\\u1ee9c ph\\u1ed1 \\u0111i b\\u1ed9 h\\u1ed3 Thi\\u1ec1n Quang\\r\\nSau kh\\u00f4ng gian \\u0111i b\\u1ed9 H\\u1ed3 G\\u01b0\\u01a1m, H\\u1ed3 T\\u00e2y (ph\\u1ed1 Tr\\u1ecbnh C\\u00f4ng S\\u01a1n), th\\u00e0nh ph\\u1ed1 ti\\u1ebfp t\\u1ee5c nghi\\u00ean c\\u1ee9u t\\u1ed5 ch\\u1ee9c tuy\\u1ebfn ph\\u1ed1 \\u0111i b\\u1ed9 khu v\\u1ef1c h\\u1ed3 Thi\\u1ec1n Quang.\\r\\n\\r\\nNg\\u00e0y 20\\/1, t\\u1ea1i cu\\u1ed9c l\\u00e0m vi\\u1ec7c c\\u1ee7a l\\u00e3nh \\u0111\\u1ea1o Th\\u00e0nh u\\u1ef7 H\\u00e0 N\\u1ed9i v\\u1edbi Qu\\u1eadn u\\u1ef7 Hai B\\u00e0 Tr\\u01b0ng, qu\\u1eadn \\u0111\\u00e3 \\u0111\\u1ec1 ngh\\u1ecb th\\u00e0nh ph\\u1ed1 cho ph\\u00e9p l\\u1eadp \\u0111\\u1ec1 \\u00e1n t\\u1ed5 ch\\u1ee9c kh\\u00f4ng gian ph\\u1ed1 \\u0111i b\\u1ed9 khu v\\u1ef1c h\\u1ed3 Thi\\u1ec1n Quang \\u0111\\u1ec3 ph\\u00e1t huy gi\\u00e1 tr\\u1ecb v\\u0103n ho\\u00e1, ki\\u1ebfn tr\\u00fac, c\\u1ea3nh quan khu v\\u1ef1c, ph\\u00e1t tri\\u1ec3n du l\\u1ecbch tr\\u00ean \\u0111\\u1ecba b\\u00e0n.\\r\\n\\r\\nTheo l\\u00e3nh \\u0111\\u1ea1o qu\\u1eadn Hai B\\u00e0 Tr\\u01b0ng, kh\\u00f4ng gian \\u0111i b\\u1ed9, kh\\u00f4ng gian v\\u0103n ho\\u00e1 khu v\\u1ef1c h\\u1ed3 Thuy\\u1ec1n Quang bao g\\u1ed3m: khu v\\u1ef1c Tr\\u1ea7n Nh\\u00e2n T\\u00f4ng (\\u0111o\\u1ea1n t\\u1eeb ph\\u1ed1 Quang Trung \\u0111\\u1ebfn Tr\\u1ea7n B\\u00ecnh Tr\\u1ecdng) v\\u00e0 khu v\\u1ef1c ph\\u1ee5 c\\u1eadn ( c\\u00f4ng vi\\u00ean Th\\u1ed1ng Nh\\u1ea5t, v\\u01b0\\u1eddn hoa, \\u0111\\u01b0\\u1eddng d\\u1ea1o quanh h\\u1ed3 Thi\\u1ec1n Quang, nh\\u00e0 v\\u0103n ho\\u00e1 Thanh Thi\\u1ebfu Ni\\u00ean).\",\"_token\":\"psoACw3S0lTlgPKVtFaCRZwwYp2ikiUFwBjDWRTk\",\"_previous_\":\"http:\\/\\/truyenthanh.org.vn:8888\\/admin\\/docs\"}','2021-01-20 07:19:08','2021-01-20 07:19:08'),(9821,1,'admin/docs','GET','27.69.14.125','[]','2021-01-20 07:19:10','2021-01-20 07:19:10'),(9822,1,'admin/docs/14/edit'