1ee7 s\\u00e2n Old Trafford \\u0111ang c\\u00f3 trong tay \\u0111\\u1ea7y \\u0111\\u1ee7 nh\\u1eefng nh\\u00e2n t\\u1ed1 s\\u00e1ng gi\\u00e1 nh\\u1ea5t \\u0111\\u1ec3 \\u0111\\u1ed1i \\u0111\\u1ea7u v\\u1edbi The Kop.\\r\\n\\r\\nTr\\u1eadn \\u0111\\u1ea1i chi\\u1ebfn gi\\u1eefa Liverpool v\\u00e0 Manchester United \\u0111ang thu h\\u00fat \\u0111\\u01b0\\u1ee3c s\\u1ef1 quan t\\u00e2m \\u0111\\u1eb7c bi\\u1ec7t c\\u1ee7a gi\\u1edbi truy\\u1ec1n th\\u00f4ng v\\u00ec t\\u00ednh ch\\u1ea5t quan tr\\u1ecdng \\u1ea3nh h\\u01b0\\u1edfng t\\u1edbi cu\\u1ed9c \\u0111ua v\\u00f4 \\u0111\\u1ecbch Premier League n\\u0103m nay. B\\u1edfi l\\u1ebd, n\\u1eeda \\u0111\\u1ecf th\\u00e0nh Machester \\u0111ang n\\u1eafm trong tay 36 \\u0111i\\u1ec3m, nhi\\u1ec1u h\\u01a1n \\u0111\\u1ea1i k\\u00ecnh \\u0111\\u1ecbch c\\u1ee7a m\\u00ecnh 3 \\u0111i\\u1ec3m.\\r\\n\\r\\nN\\u1ebfu gi\\u00e0nh chi\\u1ebfn th\\u1eafng, \\u0111o\\u00e0n qu\\u00e2n c\\u1ee7a HLV Ole Gunnar Solskjaer s\\u1ebd n\\u1edbi r\\u1ed9ng kho\\u1ea3ng c\\u00e1ch, \\u0111\\u1ed3ng th\\u1eddi ti\\u1ebfp t\\u1ee5c duy tr\\u00ec c\\u00e1ch bi\\u1ec7t 7 \\u0111i\\u1ec3m v\\u1edbi m\\u1ed9t \\u0111\\u1ed1i th\\u1ee7 kh\\u00e1c l\\u00e0 Manchester City. Qu\\u1ef7 \\u0111\\u1ecf c\\u0169ng \\u0111ang n\\u1eafm trong tay kh\\u00e1 nhi\\u1ec1u l\\u1ee3i th\\u1ebf khi s\\u1edf h\\u1eefu \\u0111\\u1ed9i h\\u00ecnh t\\u01b0\\u01a1ng \\u0111\\u1ed1i ch\\u1ea5t l\\u01b0\\u1ee3ng.\\r\\n\\r\\n\\u0110\\u1eb7c bi\\u1ec7t \\u1edf h\\u00e0ng ti\\u1ec1n v\\u1ec7, M.U v\\u1eabn c\\u00f2n \\u0111\\u00f3 m\\u1ed9t Bruno Fernandes \\u0111ang c\\u00f3 phong \\u0111\\u1ed9 th\\u0103ng hoa v\\u00e0 v\\u1eeba gi\\u00e0nh gi\\u1ea3i th\\u01b0\\u1edfng \\\"C\\u1ea7u th\\u1ee7 xu\\u1ea5t s\\u1eafc nh\\u1ea5t\\\" th\\u00e1ng M\\u01b0\\u1eddi hai. V\\u00e0 trong b\\u00e0i tr\\u1ea3 l\\u1eddi ph\\u1ecfng v\\u1ea5n m\\u1edbi nh\\u1ea5t tr\\u00ean Sky Sports, Gary Neville \\u0111\\u00e3 ch\\u1ec9 ra tuy\\u1ebfn gi\\u1eefa t\\u1ed1i \\u01b0u nh\\u1ea5t d\\u00e0nh cho Manchester United.\",\"_token\":\"psoACw3S0lTlgPKVtFaCRZwwYp2ikiUFwBjDWRTk\",\"_method\":\"PUT\",\"_previous_\":\"http:\\/\\/truyenthanh.org.vn:8888\\/admin\\/docs\"}','2021-01-20 08:30:56','2021-01-20 08:30:56'),(9917,1,'admin/docs','GET','27.69.14.125','[]','2021-01-20 08:31:48','2021-01-20 08:31:48'),(9918,1,'admin/devicedata','GET','27.69.14.125','{\"_pjax\":\"#pjax-container\"}','2021-01-20 08:36:02','2021-01-20 08:36:02'),(9919,1,'admin/programs','GET','27.69.14.125','{\"_pjax\":\"#pjax-container\"}','2021-01-20 08:36:03','2021-01-20 08:36:03'),(9920,1,'admin/programs/create','GET','27.69.14.125','{\"_pjax\":\"#pjax-container\"}','2021-01-20 08:36:05','2021-01-20 08:36:05'),(9921,1,'admin/programs','GET','27.69.14.125','{\"_pjax\":\"#pjax-container\"}','2021-01-20 08:36:06','2021-01-20 08:36:06'),(9922,1,'admin/programs/create','GET','27.69.14.125','{\"_pjax\":\"#pjax-container\"}','2021-01-20 08:36:07','2021-01-20 08:36:07'),(9923,1,'admin/devices','GET','27.69.14.125','{\"_pjax\":\"#pjax-container\"}','2021-01-20 08:36:55','2021-01-20 08:36:55'),(9924,1,'admin/programs','POST','27.69.14.125','{\"name\":\"B\\u00e0i H\\u00e1t MP3\",\"mode\":\"4\",\"devices\":[\"123456789ABCDF4\",null],\"status\":\"off\",\"_token\":\"psoACw3S0lTlgPKVtFaCRZwwYp2ikiUFwBjDWRTk\",\"_previous_\":\"http:\\/\\/truyenthanh.org.vn:8888\\/admin\\/programs\"}','2021-01-20 08:37:05','2021-01-20 08:37:05'),(9925,1,'admin/programs/create','GET','27.69.14.125','[]','2021-01-20 08:37:05','2021-01-20 08:37:05'),(9926,1,'admin/programs','POST','27.69.14.125','{\"name\":\"B\\u00e0i H\\u00e1t MP3\",\"type\":\"1\",\"mode\":\"4\",\"startDate\":null,\"time\":null,\"devices\":[\"123456789ABCDF4\",null],\"status\":\"off\",\"_token\":\"psoACw3S0lTlgPKVtFaCRZwwYp2ikiUFwBjDWRTk\"}','2021-01-20 08:37:49','2021-01-20 08:37:49'),(9927,1,'admin/programs','GET','27.69.14.125','[]','2021-01-20 08:37:49','2021-01-20 08:37:49'),(9928,1,'admin/programs','GET','27.69.14.125','{\"page\":\"2\",\"_pjax\":\