,5,'admin/programs','GET','59.153.244.127','[]','2021-01-20 11:23:11','2021-01-20 11:23:11'),(10333,5,'admin/programs/30','PUT','59.153.244.127','{\"status\":\"on\",\"_token\":\"I3xZiaehU8gljMcLtSPxXjyPwbdOZkuA21BIuClx\",\"_method\":\"PUT\"}','2021-01-20 11:23:18','2021-01-20 11:23:18'),(10334,5,'admin/programs/create','GET','59.153.244.127','{\"_pjax\":\"#pjax-container\"}','2021-01-20 11:23:30','2021-01-20 11:23:30'),(10335,1,'admin/docs','GET','27.69.14.125','{\"_pjax\":\"#pjax-container\"}','2021-01-20 11:23:34','2021-01-20 11:23:34'),(10336,1,'admin/docs/12/edit','GET','27.69.14.125','{\"_pjax\":\"#pjax-container\"}','2021-01-20 11:23:40','2021-01-20 11:23:40'),(10337,1,'admin/docs/12','PUT','27.69.14.125','{\"name\":\"TINTHETHAO\",\"content\":\"\\u0110\\u1ed9i ch\\u1ee7 s\\u00e2n Old Trafford \\u0111ang c\\u00f3 trong tay \\u0111\\u1ea7y \\u0111\\u1ee7 nh\\u1eefng nh\\u00e2n t\\u1ed1 s\\u00e1ng gi\\u00e1 nh\\u1ea5t \\u0111\\u1ec3 \\u0111\\u1ed1i \\u0111\\u1ea7u v\\u1edbi The Kop.\\r\\n\\r\\nTr\\u1eadn \\u0111\\u1ea1i chi\\u1ebfn gi\\u1eefa Liverpool v\\u00e0 Manchester United \\u0111ang thu h\\u00fat \\u0111\\u01b0\\u1ee3c s\\u1ef1 quan t\\u00e2m \\u0111\\u1eb7c bi\\u1ec7t c\\u1ee7a gi\\u1edbi truy\\u1ec1n th\\u00f4ng v\\u00ec t\\u00ednh ch\\u1ea5t quan tr\\u1ecdng \\u1ea3nh h\\u01b0\\u1edfng t\\u1edbi cu\\u1ed9c \\u0111ua v\\u00f4 \\u0111\\u1ecbch Premier League n\\u0103m nay. B\\u1edfi l\\u1ebd, n\\u1eeda \\u0111\\u1ecf th\\u00e0nh Machester \\u0111ang n\\u1eafm trong tay 36 \\u0111i\\u1ec3m, nhi\\u1ec1u h\\u01a1n \\u0111\\u1ea1i k\\u00ecnh \\u0111\\u1ecbch c\\u1ee7a m\\u00ecnh 3 \\u0111i\\u1ec3m.\\r\\n\\r\\nN\\u1ebfu gi\\u00e0nh chi\\u1ebfn th\\u1eafng, \\u0111o\\u00e0n qu\\u00e2n c\\u1ee7a HLV Ole Gunnar Solskjaer s\\u1ebd n\\u1edbi r\\u1ed9ng kho\\u1ea3ng c\\u00e1ch, \\u0111\\u1ed3ng th\\u1eddi ti\\u1ebfp t\\u1ee5c duy tr\\u00ec c\\u00e1ch bi\\u1ec7t 7 \\u0111i\\u1ec3m v\\u1edbi m\\u1ed9t \\u0111\\u1ed1i th\\u1ee7 kh\\u00e1c l\\u00e0 Manchester City. Qu\\