e0nh chi\\u1ebfn th\\u1eafng, \\u0111o\\u00e0n qu\\u00e2n c\\u1ee7a HLV Ole Gunnar Solskjaer s\\u1ebd n\\u1edbi r\\u1ed9ng kho\\u1ea3ng c\\u00e1ch, \\u0111\\u1ed3ng th\\u1eddi ti\\u1ebfp t\\u1ee5c duy tr\\u00ec c\\u00e1ch bi\\u1ec7t 7 \\u0111i\\u1ec3m v\\u1edbi m\\u1ed9t \\u0111\\u1ed1i th\\u1ee7 kh\\u00e1c l\\u00e0 Manchester City. Qu\\u1ef7 \\u0111\\u1ecf c\\u0169ng \\u0111ang n\\u1eafm trong tay kh\\u00e1 nhi\\u1ec1u l\\u1ee3i th\\u1ebf khi s\\u1edf h\\u1eefu \\u0111\\u1ed9i h\\u00ecnh t\\u01b0\\u01a1ng \\u0111\\u1ed1i ch\\u1ea5t l\\u01b0\\u1ee3ng.\\r\\n\\r\\n\\u0110\\u1eb7c bi\\u1ec7t \\u1edf h\\u00e0ng ti\\u1ec1n v\\u1ec7, M.U v\\u1eabn c\\u00f2n \\u0111\\u00f3 m\\u1ed9t Bruno Fernandes \\u0111ang c\\u00f3 phong \\u0111\\u1ed9 th\\u0103ng hoa v\\u00e0 v\\u1eeba gi\\u00e0nh gi\\u1ea3i th\\u01b0\\u1edfng \\\"C\\u1ea7u th\\u1ee7 xu\\u1ea5t s\\u1eafc nh\\u1ea5t\\\" th\\u00e1ng M\\u01b0\\u1eddi hai. V\\u00e0 trong b\\u00e0i tr\\u1ea3 l\\u1eddi ph\\u1ecfng v\\u1ea5n m\\u1edbi nh\\u1ea5t tr\\u00ean Sky Sports, Gary Neville \\u0111\\u00e3 ch\\u1ec9 ra tuy\\u1ebfn gi\\u1eefa t\\u1ed1i \\u01b0u nh\\u1ea5t d\\u00e0nh cho Manchester United.\",\"_token\":\"lyLnsmGRcEiFXdiya2nSKui1DbzbQujtK27qvNJv\",\"_method\":\"PUT\",\"_previous_\":\"http:\\/\\/truyenthanh.org.vn:8888\\/admin\\/docs\"}','2021-01-20 19:57:18','2021-01-20 19:57:18'),(10886,1,'admin/docs','GET','1.55.170.138','[]','2021-01-20 19:58:11','2021-01-20 19:58:11'),(10887,1,'admin/docs/create','GET','1.55.170.138','{\"_pjax\":\"#pjax-container\"}','2021-01-20 20:00:39','2021-01-20 20:00:39'),(10888,1,'admin/docs','POST','1.55.170.138','{\"name\":\"Ph\\u00e1t thanh v\\u0103n b\\u1ea3n\",\"content\":\"To\\u00e0n c\\u1ea7u ghi nh\\u1eadn h\\u01a1n 97 tri\\u1ec7u ca nCoV, h\\u01a1n 2 tri\\u1ec7u ng\\u01b0\\u1eddi ch\\u1ebft, trong khi bi\\u1ebfn ch\\u1ee7ng virus g\\u00e2y lo ng\\u1ea1i t\\u1eeb Anh xu\\u1ea5t hi\\u1ec7n \\u1edf h\\u01a1n 60 n\\u01b0\\u1edbc.\\r\\n\\r\\nTh\\u1ebf gi\\u1edbi ghi nh\\u1eadn 97.246.135 ca 