,\"_token\":\"Pqi3KdVPRF4OiM0KwUpcQ98N2eUzSEISVV74irC5\",\"_method\":\"PUT\",\"_previous_\":\"http:\\/\\/truyenthanh.org.vn:8888\\/admin\\/programs\"}','2021-02-24 04:50:05','2021-02-24 04:50:05'),(12255,5,'admin/programs','GET','113.160.21.10','[]','2021-02-24 04:50:05','2021-02-24 04:50:05'),(12256,5,'admin/devicedata/12','PUT','113.160.21.10','{\"name\":\"volume\",\"value\":\"5\",\"pk\":\"12\",\"_token\":\"Pqi3KdVPRF4OiM0KwUpcQ98N2eUzSEISVV74irC5\",\"_editable\":\"1\",\"_method\":\"PUT\"}','2021-02-24 04:50:34','2021-02-24 04:50:34'),(12257,5,'admin/devicedata/12','PUT','113.160.21.10','{\"name\":\"volume\",\"value\":\"10\",\"pk\":\"12\",\"_token\":\"Pqi3KdVPRF4OiM0KwUpcQ98N2eUzSEISVV74irC5\",\"_editable\":\"1\",\"_method\":\"PUT\"}','2021-02-24 04:50:39','2021-02-24 04:50:39'),(12258,5,'admin/devicedata/12','PUT','113.160.21.10','{\"name\":\"volume\",\"value\":\"8\",\"pk\":\"12\",\"_token\":\"Pqi3KdVPRF4OiM0KwUpcQ98N2eUzSEISVV74irC5\",\"_editable\":\"1\",\"_method\":\"PUT\"}','2021-02-24 04:50:48','2021-02-24 04:50:48'),(12259,5,'admin/programs/74/edit','GET','113.160.21.10','{\"_pjax\":\"#pjax-container\"}','2021-02-24 04:52:46','2021-02-24 04:52:46'),(12260,5,'admin/docs','GET','113.160.21.10','{\"_pjax\":\"#pjax-container\"}','2021-02-24 04:52:49','2021-02-24 04:52:49'),(12261,5,'admin/docs/34','GET','113.160.21.10','{\"_pjax\":\"#pjax-container\"}','2021-02-24 04:52:55','2021-02-24 04:52:55'),(12262,5,'admin/docs/34/edit','GET','113.160.21.10','{\"_pjax\":\"#pjax-container\"}','2021-02-24 04:53:40','2021-02-24 04:53:40'),(12263,5,'admin/docs/34','PUT','113.160.21.10','{\"name\":\"VINECO test v\\u0103n b\\u1ea3n\",\"content\":\"Ph\\u00f3 Th\\u1ee7 t\\u01b0\\u1edbng V\\u0169 \\u0110\\u1ee9c \\u0110am nh\\u1ea5n m\\u1ea1nh: D\\u00e2n s\\u1ed1 c\\u1ee7a Vi\\u1ec7t Nam \\u0111\\u1ee9ng th\\u1ee9 15 tr\\u00ean th\\u1ebf gi\\u1edbi. Hi\\u1ec7n t\\u1ed5ng s\\u1ed1 ca nhi\\u1ec5m c\\u1ee7a Vi\\u1ec7t Nam \\u0111\\u1ee9ng th\\u1ee9 173, nh\\u01b0ng t\\u00ednh theo t\\u1ef7 l\\u1ec7 ca nhi\\u1ec5m tr\\u00ean s\\u1ed1 d\\u00e2n th\\u00ec \\u0111\\u1ee9ng th\\u1ee9 213\\/219 qu\\u1ed1c gia, v\\u00f9ng l\\u00e3nh th\\u1ed5. \\u0110\\u1eb7c bi\\u1ec7t chi ph\\u00ed ch\\u1ed1ng d\\u1ecbch c\\u1ee7a Vi\\u1ec7t Nam r\\u1ea5t th\\u1ea5p. S\\u1ed1 l\\u01b0\\u1ee3ng x\\u00e9t nghi\\u1ec7m tr\\u00ean s\\u1ed1 d\\u00e2n \\u0111\\u1ee9ng th\\u1ee9 176 tr\\u00ean th\\u1ebf gi\\u1edbi.\\r\\n\\u201cB\\u1eb1ng t\\u1ea5t c\\u1ea3 s\\u1ef1 khi\\u00eam t\\u1ed1n, c\\u00f3 th\\u1ec3 n\\u00f3i r\\u1eb1ng Vi\\u1ec7t Nam \\u0111\\u01b0\\u1ee3c th\\u1ebf gi\\u1edbi \\u0111\\u00e1nh gi\\u00e1 l\\u00e0 m\\u1ed9t trong nh\\u1eefng n\\u01b0\\u1edbc ch\\u1ed1ng d\\u1ecbch hi\\u1ec7u qu\\u1ea3 nh\\u1ea5t. V\\u00ec v\\u1eady, ch\\u00fang ta ph\\u1ea3i ki\\u00ean tr\\u00ec nguy\\u00ean t\\u1eafc, chi\\u1ebfn l\\u01b0\\u1ee3c ch\\u1ed1ng d\\u1ecbch t\\u1eeb nh\\u1eefng ng\\u00e0y \\u0111\\u1ea7u. Trong t\\u1eebng th\\u1eddi k\\u1ef3 th\\u00ec chi\\u1ebfn thu\\u1eadt thay \\u0111\\u1ed5i linh ho\\u1ea1t, nh\\u01b0ng chi\\u1ebfn l\\u01b0\\u1ee3c 5 b\\u01b0\\u1edbc Ng\\u0103n ch\\u1eb7n - Ph\\u00e1t hi\\u1ec7n - C\\u00e1ch ly - Khoanh v\\u00f9ng - D\\u1eadp d\\u1ecbch - \\u0110i\\u1ec1u tr\\u1ecb th\\u00ec kh\\u00f4ng thay \\u0111\\u1ed5i, \\u0111\\u1eb7c bi\\u1ec7t l\\u00e0 ph\\u00e1t hi\\u1ec7n, truy v\\u1ebft v\\u00e0 b\\u00e2y gi\\u1edd th\\u00eam s\\u00e0ng l\\u1ecdc c\\u1ed9ng \\u0111\\u1ed3ng c\\u00f3 tr\\u1ecdng t\\u00e2m, tr\\u1ecdng \\u0111i\\u1ec3m\\u201d, Ph\\u00f3 Th\\u1ee7 t\\u01b0\\u1edbng n\\u00f3i.\\r\\n\\r\\nPh\\u00f3 Th\\u1ee7 t\\u01b0\\u1edbng V\\u0169 \\u0110\\u1ee9c \\u0110am \\u0111\\u00e1nh gi\\u00e1: \\u0110\\u1ebfn gi\\u1edd ph\\u00fat n\\u00e0y c\\u00f3 th\\u1ec3 n\\u00f3i v\\u1ec1 c\\u01a1 b\\u1ea3n d\\u1ecbch b\\u1ec7nh \\u0111\\u01b0\\u1ee3c ki\\u1ec3m so\\u00e1t t\\u1ed1t tr\\u00ean c\\u1ea3 n\\u01b0\\u1edbc. Ngay c\\u1ea3 H\\u1ea3i D\\u01b0\\u01a1ng, khi ph\\u00e2n t\\u00edch k\\u1ef9 d\\u1eef li\\u1ec7u \\u0111\\u1ebfn nay ch\\u1ec9 ph\\u00e1t hi\\u1ec7n 3 ca m\\u1eafc COVID-19 t\\u1ea1i c\\u1ed9ng \\u0111\\u1ed3ng kh\\u00f4ng n\\u1eb1m trong c\\u00e1c khu v\\u1ef1c phong t\\u1ecfa hay khu c\\u00e1ch ly t\\u1eadp trung v\\u00e0 c\\u1ea3 3 ca n\\u00e0y \\u0111\\u1ec1u \\u0111\\u00e3 truy v\\u1ebft \\u0111\\u01b0\\u1ee3c.\\r\\n\\r\\nTh\\u1eddi gian t\\u1edbi, Ph\\u00f3 Th\\u1ee7 t\\u01b0\\u1edbng \\u0111\\u1ec1 ngh\\u1ecb t\\u1ec9nh H\\u1ea3i D\\u01b0\\u01a1ng ph\\u1ea3i ti\\u1ebfp t\\u1ee5c m\\u0169i x\\u00e9t nghi\\u1ec7m ch\\u00ednh l\\u00e0 truy v\\u1ebft, theo d\\u1ea5u ca b\\u1ec7nh.\\r\\n\\r\\n\\u0110\\u1ed1i v\\u1edbi x\\u00e9t nghi\\u1ec7m t\\u1ea7m so\\u00e1t di\\u1ec7n r\\u1ed9ng trong c\\u1ed9ng \\u0111\\u1ed3ng, B\\u1ed9 Y t\\u1ebf ph\\u1ea3i c\\u00f3 h\\u01b0\\u1edbng d\\u1eabn, H\\u1ea3i D\\u01b0\\u01a1ng ph\\u1ea3i ch\\u1ec9 \\u0111\\u1ea1o r\\u1ea5t c\\u1ee5 th\\u1ec3 nh\\u00e0 m\\u00e1y, x\\u00ed nghi\\u1ec7p n\\u00e0o, \\u1edf khu v\\u1ef1c n\\u00e0o b\\u1eaft bu\\u1ed9c x\\u00e9t nghi\\u1ec7m cho c\\u00f4ng nh\\u00e2n m\\u1edbi \\u0111\\u01b0\\u1ee3c ho\\u1ea1t \\u0111\\u1ed9ng \\u0111\\u1ec3 tr\\u00e1nh l\\u00e3ng ph\\u00ed.\\r\\n\\r\\nPh\\u00f3 Th\\u1ee7 t\\u01b0\\u1edbng l\\u01b0u \\u00fd, k\\u1ec3 c\\u1ea3 sau khi t\\u1ec9nh H\\u1ea3i D\\u01b0\\u01a1ng \\u0111\\u00e3 h\\u1ebft d\\u1ecbch th\\u00ec v\\u1eabn ph\\u1ea3i s\\u1eb5n s\\u00e0ng c\\u0169ng nh\\u01b0 c\\u00e1c \\u0111\\u1ecba ph\\u01b0\\u01a1ng kh\\u00e1c trong c\\u1ea3 n\\u01b0\\u1edbc. B\\u1edfi v\\u00ec v\\u1edbi 100 tri\\u1ec7u d\\u00e2n, \\u0111\\u01b0\\u1eddng bi\\u00ean gi\\u1edbi r\\u1ea5t d\\u00e0i, n\\u1ec1n kinh t\\u1ebf m\\u1edf, ch\\u00fang ta v\\u1eabn ph\\u1ea3i \\u0111\\u00f3n chuy\\u00ean gia n\\u01b0\\u1edbc ngo\\u00e0i v\\u00e0o ph\\u1ee5c v\\u1ee5 ph\\u00e1t tri\\u1ec3n kinh t\\u1ebf - x\\u00e3 h\\u1ed9i th\\u00ec \\u201ckh\\u00f4ng ai c\\u00f3 th\\u1ec3 n\\u00f3i Vi\\u1ec7t Nam tuy\\u1ec7t \\u0111\\u1ed1i kh\\u00f4ng c\\u00f3 m\\u1ea7m b\\u1ec7nh trong c\\u1ed9ng \\u0111\\u1ed3ng. L\\u00fac n\