PUT\"}','2021-03-06 03:12:19','2021-03-06 03:12:19'),(13123,5,'admin/programs','GET','113.160.21.10','[]','2021-03-06 03:12:19','2021-03-06 03:12:19'),(13124,5,'admin/docs','GET','113.160.21.10','{\"_pjax\":\"#pjax-container\"}','2021-03-06 03:12:25','2021-03-06 03:12:25'),(13125,5,'admin/docs/38/edit','GET','113.160.21.10','{\"_pjax\":\"#pjax-container\"}','2021-03-06 03:12:31','2021-03-06 03:12:31'),(13126,5,'admin/docs/38','PUT','113.160.21.10','{\"name\":\"Th\\u01a1: Em b\\u1ea3o anh \\u0111i \\u0111i\",\"content\":\"\\u0110\\u00e2y l\\u00e0 ch\\u01b0\\u01a1ng tr\\u00ecnh ph\\u00e1t thanh cu\\u1ed1i ng\\u00e0y c\\u1ee7a Truy\\u1ec1n thanh th\\u00f4ng minh Vi Ne C\\u00f4. Xin g\\u1eedi \\u0111\\u1ebfn t\\u1ea5t c\\u1ea3 m\\u1ecdi ng\\u01b0\\u1eddi m\\u1ed9t t\\u00e1c ph\\u1ea9m th\\u01a1 t\\u00ecnh\\r\\nr\\u1ea5t hay c\\u1ee7a Nh\\u00e0 th\\u01a1 Puskin. M\\u1eddi m\\u1ecdi ng\\u01b0\\u1eddi c\\u00f9ng l\\u1eafng nghe:\\r\\n\\r\\nEm b\\u1ea3o: \\\"Anh \\u0111i \\u0111i!\\r\\n\\\"Sao anh kh\\u00f4ng \\u0111\\u1ee9ng l\\u1ea1i?\\r\\nEm b\\u1ea3o: \\\"Anh \\u0111\\u1eebng \\u0111\\u1ee3i\\\"!\\r\\nSao anh v\\u1ed9i v\\u1ec1 ngay?\\r\\n\\r\\nL\\u1eddi n\\u00f3i, tho\\u1ea3ng gi\\u00f3 bay.\\r\\n\\u0110\\u00f4i m\\u1eaft huy\\u1ec1n, \\u0111\\u1eabm l\\u1ec7.\\r\\nM\\u00e0 sao, anh d\\u1ea1i th\\u1ebf!\\r\\nKh\\u00f4ng nh\\u00ecn v\\u00e0o m\\u1eaft em?\\r\\n\\r\\nM\\u00e0 sao, anh d\\u1ea1i th\\u1ebf!\\r\\nKh\\u00f4ng nh\\u00ecn, v\\u00e0o m\\u1eaft em?\\r\\nKh\\u00f4ng nh\\u00ecn, v\\u00e0o m\\u1eaft s\\u1ea7u?\\r\\nKh\\u00f4ng nh\\u00ecn, v\\u00e0o m\\u1eaft s\\u00e2u?\\r\\n\\r\\nNh\\u1eefng chuy\\u1ec7n bu\\u1ed3n, qua \\u0111i.\\r\\nXin anh, kh\\u00f4ng nh\\u1eafc l\\u1ea1i!\\r\\nEm ngu kh\\u1edd, v\\u1ee5ng d\\u1ea1i.\\r\\nAnh m\\u01a1 m\\u1ed9ng, vi\\u1ec5n v\\u00f4ng.\\r\\n\\r\\n\\u0110\\u1eddi s\\u1ed1ng nghi\\u1ec7t ng\\u00e3 kh\\u00f4ng.\\r\\nCho ch\\u00fang m\\u00ecnh, \\u1ea5m m\\u1ed9ng.\\r\\nTh\\u00ec th\\u00f4i, xin g\\u1eedi s\\u00f3ng.\\r\\n\\u0110\\u01b0a t\\u00ecnh, v\\u1ec1 cu\\u1ed1i s\\u00f4ng.\\r\\n\\r\\nTh\\u00ec th\\u00f4i, xin g\\u1eedi s\\u00f3ng.\\r\\n\\u0110\\u01b0a t\\u00ecnh, v\\u1ec1 cu\\u1ed1i s\\u00f4ng.\\r\\n\\u0110\\u01b0a t\\u00ecnh, v\\u1ec1 v\\u1edbi m\\u1ed9ng.\\r\\n\\u0110\\u01b0a t\\u00ccnh, v\\u00e0o c\\u00f5i kh\\u00f4ng.\",\"_token\":\"lmITfyVh8Bh2JWFQ2wzbzJ8HDJISNBWnGHJngWOQ\",\"_method\":\"PUT\",\"_previous_\":\"http:\\/\\/truyenthanh.org.vn:8888\\/admin\\/docs\"}','2021-03-06 03:12:34','2021-03-06 03:12:34'),(13127,5,'admin/docs','GET','113.160.21.10','[]','2021-03-06 03:13:26','2021-03-06 03:13:26'),(13128,5,'admin/devicedata','GET','113.160.21.10','{\"_pjax\":\"#pjax-container\"}','2021-03-06 03:13:36','2021-03-06 03:13:36'),(13129,5,'admin/programs','GET','113.160.21.10','{\"_pjax\":\"#pjax-container\"}','2021-03-06 03:13:37','2021-03-06 03:13:37'),(13130,5,'admin/programs/79/edit','GET','113.160.21.10','{\"_pjax\":\"#pjax-container\"}','2021-03-06 03:13:42','2021-03-06 03:13:42'),(13131,5,'admin/programs/79','PUT','113.160.21.10','{\"name\":\"123456789ABCF1\",\"type\":\"4\",\"document_Id\":\"22\",\"mode\":\"4\",\"devices\":[\"123456789ABCDF4\",\"123456789ABC010\",\"123456789ABC025\",null],\"status\":\"on\",\"_token\":\"lmITfyVh8Bh2JWFQ2wzbzJ8HDJISNBWnGHJngWOQ\",\"_method\":\"PUT\",\"_previous_\":\"http:\\/\\/truyenthanh.org.vn:8888\\/admin\\/programs\"}','2021-03-06 03:13:54','2021-03-06 03:13:54'),(13132,5,'admin/programs','GET','113.160.21.10','[]','2021-03-06 03:13:54','2021-03-06 03:13:54'),(13133,5,'admin/programs/79/edit','GET','113.160.21.10','{\"_pjax\":\"#pjax-container\"}','2021-03-06 03:14:19','2021-03-06 03:14:19'),(13134,5,'admin/programs/79','PUT','113.160.21.10','{\"name\":\"123456789ABCF1\",\"type\":\"4\",\"document_Id\":\"22\",\"mode\":\"4\",\"devices\":[\"123456789ABCDF4\",\"123456789ABC010\",\"123456789ABC025\",null],\"status\":\"on\",\"_token\":\"lmITfyVh8Bh2JWFQ2wzbzJ8HDJISNBWnGHJngWOQ\",\"_method\":\"PUT\",\"_previous_\":\"http:\\/\\/truyenthanh.org.vn:88