0e0 sao, anh d\\u1ea1i th\\u1ebf!\\r\\nKh\\u00f4ng nh\\u00ecn, v\\u00e0o m\\u1eaft em?\\r\\nKh\\u00f4ng nh\\u00ecn, v\\u00e0o m\\u1eaft s\\u1ea7u?\\r\\nKh\\u00f4ng nh\\u00ecn, v\\u00e0o m\\u1eaft s\\u00e2u?\\r\\n\\r\\nNh\\u1eefng chuy\\u1ec7n bu\\u1ed3n, qua \\u0111i.\\r\\nXin anh, kh\\u00f4ng nh\\u1eafc l\\u1ea1i!\\r\\nEm ngu kh\\u1edd, v\\u1ee5ng d\\u1ea1i.\\r\\nAnh m\\u01a1 m\\u1ed9ng, vi\\u1ec5n v\\u00f4ng.\\r\\n\\r\\n\\u0110\\u1eddi s\\u1ed1ng nghi\\u1ec7t ng\\u00e3 kh\\u00f4ng.\\r\\nCho ch\\u00fang m\\u00ecnh, \\u1ea5m m\\u1ed9ng.\\r\\nTh\\u00ec th\\u00f4i, xin g\\u1eedi s\\u00f3ng.\\r\\n\\u0110\\u01b0a t\\u00ecnh, v\\u1ec1 cu\\u1ed1i s\\u00f4ng.\\r\\n\\r\\nTh\\u00ec th\\u00f4i, xin g\\u1eedi s\\u00f3ng.\\r\\n\\u0110\\u01b0a t\\u00ecnh, v\\u1ec1 cu\\u1ed1i s\\u00f4ng.\\r\\n\\u0110\\u01b0a t\\u00ecnh, v\\u1ec1 v\\u1edbi m\\u1ed9ng.\\r\\n\\u0110\\u01b0a t\\u00ccnh, v\\u00e0o c\\u00f5i kh\\u00f4ng.\",\"_token\":\"axSGgzarDL3hc7j8IdbxnxcsgTEIIptxm4g7ToaN\",\"_method\":\"PUT\",\"_previous_\":\"http:\\/\\/truyenthanh.org.vn:8888\\/admin\\/docs\"}','2021-03-08 03:22:38','2021-03-08 03:22:38'),(13251,5,'admin/programs','GET','113.160.21.10','{\"_pjax\":\"#pjax-container\"}','2021-03-08 03:23:34','2021-03-08 03:23:34'),(13252,5,'admin/docs','GET','113.160.21.10','[]','2021-03-08 03:23:34','2021-03-08 03:23:34'),(13253,5,'admin/docs/38/edit','GET','113.160.21.10','{\"_pjax\":\"#pjax-container\"}','2021-03-08 03:23:49','2021-03-08 03:23:49'),(13254,5,'admin/docs/38','PUT','113.160.21.10','{\"name\":\"Th\\u01a1: Em b\\u1ea3o anh \\u0111i \\u0111i\",\"content\":\"\\u0110\\u00e2y l\\u00e0 ch\\u01b0\\u01a1ng tr\\u00ecnh ph\\u00e1t thanh cu\\u1ed1i ng\\u00e0y c\\u1ee7a Truy\\u1ec1n thanh th\\u00f4ng minh Vi Ne C\\u00f4. Xin g\\u1eedi \\u0111\\u1ebfn t\\u1ea5t c\\u1ea3 m\\u1ecdi ng\\u01b0\\u1eddi m\\u1ed9t t\\u00e1c ph\\u1ea9m th\\u01a1 t\\u00ecnh\\r\\nr\\u1ea5t hay c\\u1ee7a Nh\\u00e0 th\\u01a1 Puskin. M\\u1eddi m\\u1ecdi ng\\u01b0\\u1eddi c\\u00f9ng l\\u1eafng nghe:\\r\\n\\r