INSERT INTO `documents` VALUES (12,'TINTHETHAO','Đội chủ sân Old Trafford đang có trong tay đầy đủ những nhân tố sáng giá nhất để đối đầu với The Kop.\r\n\r\nTrận đại chiến giữa Liverpool và Manchester United đang thu hút được sự quan tâm đặc biệt của giới truyền thông vì tính chất quan trọng ảnh hưởng tới cuộc đua vô địch Premier League năm nay. Bởi lẽ, nửa đỏ thành Machester đang nắm trong tay 36 điểm, nhiều hơn đại kình địch của mình 3 điểm.\r\n\r\nNếu giành chiến thắng, đoàn quân của HLV Ole Gunnar Solskjaer sẽ nới rộng khoảng cách, đồng thời tiếp tục duy trì cách biệt 7 điểm với một đối thủ khác là Manchester City. Quỷ đỏ cũng đang nắm trong tay khá nhiều lợi thế khi sở hữu đội hình tương đối chất lượng.\r\n\r\nĐặc biệt ở hàng tiền vệ, M.U vẫn còn đó một Bruno Fernandes đang có phong độ thăng hoa và vừa giành giải thưởng \"Cầu thủ xuất sắc nhất\" tháng Mười hai. Và trong bài trả lời phỏng vấn mới nhất trên Sky Sports, Gary Neville đã chỉ ra tuyến giữa tối ưu nhất dành cho Manchester United.','34e8f36ffa4382a26c3a7756f553538e.mp3','2021-01-16 23:00:31','2021-01-20 19:58:11'),(21,'Phát thanh văn bản','Toàn cầu ghi nhận hơn 97 triệu ca nCoV, hơn 2 triệu người chết, trong khi biến chủng virus gây lo ngại từ Anh xuất hiện ở hơn 60 nước.\r\n\r\nThế giới ghi nhận 97.246.135 ca nhiễm và 2.080.636 người chết do Covid-19, tăng lần lượt 687.793 và 17.407 ca trong 24 giờ qua. 69.791.796 người đã bình phục, theo trang cập nhật thời gian thực Worldometers.\r\n\r\nTổ chức Y tế Thế giới (WHO) hôm 20/1 cảnh báo biến chủng nCoV mới từ Anh đã xuất hiện tại hơn 60 quốc gia. 23 quốc gia và vùng lãnh thổ cũng ghi nhận chủng mới từ Nam Phi. Cả hai biến chủng này đều được cho là có khả năng lây nhiễm cao hơn, thúc đẩy giới chức các nước thắt chặt những biện pháp hạn chế.','beba8ee90b2933d8b90dfc95881ab1fe.mp3','2021-01-20 20:01:09','2021-01-20 20:01:39'),(22,'Bản tin thời sự','Ông Biden cũng quyết định thu hồi giấy phép cấp cho dự án đường ống dẫn đầu gây tranh cãi Keystone XL giữa Mỹ và Canada, chỉ đạo tất cả các cơ quan hành pháp rà soát lại các hành động hủy hoại môi trường. Ông cũng yêu cầu các cơ quan liên bang đánh giá về tính bình đẳng trong các chính sách hiện tại và đặt mục tiêu giải quyết vấn đề bất bình đẳng trong vòng 200 ngày đầu nhiệm sở.\r\n\r\nPhát biểu trước khi ký các sắc lệnh hành pháp, ông Biden nói: \"Tôi nghĩ một số điều mà chúng tôi sắp làm là vô cùng cần thiết và không còn thời gian nào phù hợp hơn hôm nay để bắt tay vào việc\".','4479019baf89a734255684b62c26bebe.mp3','2021-01-20 20:10:30','2021-01-20 20:12:30'),(24,'Bản tin thể thao buổi sáng','Thời gian gần đây, thị trường đón nhận nhiều dự án căn hộ mới chào sân. Những dự án có vị trí gần hồ luôn được khách hàng và nhà đầu tư đặc biệt quan tâm bởi sức hút đến từ không gian sống thoáng đãng và khả năng tăng giá vô cùng hấp dẫn. Theo đó, BĐS gần hồ trở thành tiêu chí ưu tiên hàng đầu trong lựa chọn của người mua nhà.\r\n\r\nThống kê từ nghiên cứu của Savills, giá bất động sản ven sông, hồ tại các thành phố lớn trên thế giới thường cao hơn từ 10 - 50% so với khu vực khác. Cụ thể là 50% tại London, Paris; 20% tại Thượng Hải và Sydney; ....','3e549b60af9cf5b5464871ffed399e71.mp3','2021-01-20 20:20:51','2021-01-21 02:31:13'),(25,'aaa','Phát biểu tại Hội nghị triển khai công tác bầu cử ĐBQH khóa XV và đại biểu HĐND các cấp nhiệm kỳ 2021 - 2026 do Bộ Chính trị chủ trì sáng nay (21/1), Tổng Bí thư, Chủ tịch nước Nguyễn Phú Trọng nhấn mạnh, cuộc bầu cử diễn ra vào thời điểm có ý nghĩa đặc biệt quan trọng.\r\n\r\nĐợt sinh hoạt dân chủ sâu rộng trong mọi tầng lớp nhân dân\r\n\r\nTheo Tổng Bí thư, Chủ tịch nước Nguyễn Phú Trọng, cùng với sự kiện có ý nghĩa chính trị quan trọng là Đại hội Đại biểu toàn quốc lần thứ XIII của Đảng, cuộc bầu cử ĐBQH khóa XV và đại biểu HĐND các cấp nhiệm kỳ 2021-2026 là hoạt động chính trị quan trọng, đợt sinh hoạt dân chủ sâu rộng trong mọi tầng lớp nhân dân.','47bce5c74f589f4867dbd57e9ca9f808.mp3','2021-01-20 23:48:35','2021-01-21 02:32:36'),(26,'bbb','Phát biểu tại Hội nghị triển khai công tác bầu cử ĐBQH khóa XV và đại biểu HĐND các cấp nhiệm kỳ 2021 - 2026 do Bộ Chính trị chủ trì sáng nay (21/1), Tổng Bí thư, Chủ tịch nước Nguyễn Phú Trọng nhấn mạnh, cuộc bầu cử diễn ra vào thời điểm có ý nghĩa đặc biệt quan trọng.\r\n\r\nĐợt sinh hoạt dân chủ sâu rộng trong mọi tầng lớp nhân dân\r\n\r\nTheo Tổng Bí thư, Chủ tịch nước Nguyễn Phú Trọng, cùng với sự kiện có ý nghĩa chính trị quan trọng là Đại hội Đại biểu toàn quốc lần thứ XIII của Đảng, cuộc bầu cử ĐBQH khóa XV và đại biểu HĐND các cấp nhiệm kỳ 2021-2026 là hoạt động chính trị quan trọng, đợt sinh hoạt dân chủ sâu rộng trong mọi tầng lớp nhân dân.','08f8e0260c64418510cefb2b06eee5cd.mp3','2021-01-21 01:53:10','2021-01-21 02:33:07'),(27,'ccc','13h30 ngày 22/1, Phó Thủ tướng Vũ Đức Đam, Thứ trưởng Y tế Nguyễn Trường Sơn, Thứ trưởng Khoa học và Công nghệ Bùi Thế Duy sẽ trả lời phỏng vấn trực tuyến VnExpress về một năm chống Covid-19.\r\n\r\nNăm 2020, Việt Nam khống chế thành công đại dịch Covid-19, đảm bảo thực hiện hai mục tiêu vừa chống dịch vừa phát triển kinh tế. Để đạt thành công này, Chính phủ và các Bộ, ngành cùng Ban chỉ đạo Quốc gia phòng, chống dịch đã đưa ra những quyết định cấp thiết, trong những thời khắc quan trọng, thực hiện nhiều biện pháp chưa từng có','9df62e693988eb4e1e1444ece0578579.mp3','2021-01-21 02:37:02','2021-01-21 02:37:26'),(28,'ddd','13h30 ngày 22/1, Phó Thủ tướng Vũ Đức Đam, Thứ trưởng Y tế Nguyễn Trường Sơn, Thứ trưởng Khoa học và Công nghệ Bùi Thế Duy sẽ trả lời phỏng vấn trực tuyến VnExpress về một năm chống Covid-19.\r\n\r\nNăm 2020, Việt Nam khống chế thành công đại dịch Covid-19, đảm bảo thực hiện hai mục tiêu vừa chống dịch vừa phát triển kinh tế. Để đạt thành công này, Chính phủ và các Bộ, ngành cùng Ban chỉ đạo Quốc gia phòng, chống dịch đã đưa ra những quyết định cấp thiết, trong những thời khắc quan trọng, thực hiện nhiều biện pháp chưa từng có','77963b7a931377ad4ab5ad6a9cd718aa.mp3','2021-01-21 02:43:27','2021-01-21 02:48:12'),(29,'EEE','Alcoyano hiện thi đấu tại hạng Ba, giải kém hai bậc so với La Liga. Mùa này, họ mới giành quyền lên chơi từ giải hạng tư. Bên cạnh lương cầu thủ, Alcoyano còn phải dùng ngân sách để trả lương cho HLV và nhân viên CLB.\r\n\r\nỞ vòng 32 đội Cup Nhà Vua hôm 20/1, Alcoyano gây bất ngờ lớn khi loại Real với tỷ số 2-1. Từ chỗ để thua cuối hiệp một, đội hạng ba thi đấu kiên cường, gỡ hòa ở phút 80 và ghi bàn quyết định ở phút 115.','e8d920ed9dcdfa798d5ddd0d2340e1ca.mp3','2021-01-21 02:49:19','2021-01-21 02:50:14'),(30,'FFF','Alcoyano hiện thi đấu tại hạng Ba, giải kém hai bậc so với La Liga. Mùa này, họ mới giành quyền lên chơi từ giải hạng tư. Bên cạnh lương cầu thủ, Alcoyano còn phải dùng ngân sách để trả lương cho HLV và nhân viên CLB.\r\n\r\nỞ vòng 32 đội Cup Nhà Vua hôm 20/1, Alcoyano gây bất ngờ lớn khi loại Real với tỷ số 2-1. Từ chỗ để thua cuối hiệp một, đội hạng ba thi đấu kiên cường, gỡ hòa ở phút 80 và ghi bàn quyết định ở phút 115.','2804890a4b43e24d922447ddaaad3b2a.mp3','2021-01-21 02:52:01','2021-01-21 02:53:42'),(31,'GGG','Cùng vụ án, Trịnh Xuân Thanh (cựu tổng giám đốc, Chủ tịch HĐQT PVC) về tội Vi phạm quy định về đầu tư công trình xây dựng gây hậu quả nghiêm trọng, theo khoản 3 điều 224 Bộ luật Hình sự 2015 và Lợi dụng chức vụ quyền hạn trong thi hành công vụ, theo khoản 3 điều 356.','9af3a2bdc0c8780394fe540db548e97d.mp3','2021-01-21 03:00:50','2021-01-21 03:03:15'),(32,'iii','Cùng vụ án, Trịnh Xuân Thanh (cựu tổng giám đốc, Chủ tịch HĐQT PVC) về tội Vi phạm quy định về đầu tư công trình xây dựng gây hậu quả nghiêm trọng, theo khoản 3 điều 224 Bộ luật Hình sự 2015 và Lợi dụng chức vụ quyền hạn trong thi hành công vụ, theo khoản 3 điều 356.','36347412c7d30ae6fde3742bbc4f21b9.mp3','2021-01-21 03:15:56','2021-01-21 03:16:27'),(33,'eee','Cùng vụ án, Trịnh Xuân Thanh (cựu tổng giám đốc, Chủ tịch HĐQT PVC) về tội Vi phạm quy định về đầu tư công trình xây dựng gây hậu quả nghiêm trọng, theo khoản 3 điều 224 Bộ luật Hình sự 2015 và Lợi dụng chức vụ quyền hạn trong thi hành công vụ, theo khoản 3 điều 356.','d2f2297d6e829cd3493aa7de4416a18f.mp3','2021-01-21 03:18:05','2021-01-21 03:18:17'),(34,'VINECO test văn bản','Phó Thủ tướng Vũ Đức Đam nhấn mạnh: Dân số của Việt Nam đứng thứ 15 trên thế giới. Hiện tổng số ca nhiễm của Việt Nam đứng thứ 173, nhưng tính theo tỷ lệ ca nhiễm trên số dân thì đứng thứ 213/219 quốc gia, vùng lãnh thổ. Đặc biệt chi phí chống dịch của Việt Nam rất thấp. Số lượng xét nghiệm trên số dân đứng thứ 176 trên thế giới.\r\n“Bằng tất cả sự khiêm tốn, có thể nói rằng Việt Nam được thế giới đánh giá là một trong những nước chống dịch hiệu quả nhất. Vì vậy, chúng ta phải kiên trì nguyên tắc, chiến lược chống dịch từ những ngày đầu. Trong từng thời kỳ thì chiến thuật thay đổi linh hoạt, nhưng chiến lược 5 bước Ngăn chặn - Phát hiện - Cách ly - Khoanh vùng - Dập dịch - Điều trị thì không thay đổi, đặc biệt là phát hiện, truy vết và bây giờ thêm sàng lọc cộng đồng có trọng tâm, trọng điểm”, Phó Thủ tướng nói.\r\n\r\nPhó Thủ tướng Vũ Đức Đam đánh giá: Đến giờ phút này có thể nói về cơ bản dịch bệnh được kiểm soát tốt trên cả nước. Ngay cả Hải Dương, khi phân tích kỹ dữ liệu đến nay chỉ phát hiện 3 ca mắc COVID-19 tại cộng đồng không nằm trong các khu vực phong tỏa hay khu cách ly tập trung và cả 3 ca này đều đã truy vết được.\r\n\r\nThời gian tới, Phó Thủ tướng đề nghị tỉnh Hải Dương phải tiếp tục mũi xét nghiệm chính là truy vết, theo dấu ca bệnh.\r\n\r\nĐối với xét nghiệm tầm soát diện rộng trong cộng đồng, Bộ Y tế phải có hướng dẫn, Hải Dương phải chỉ đạo rất cụ thể nhà máy, xí nghiệp nào, ở khu vực nào bắt buộc xét nghiệm cho công nhân mới được hoạt động để tránh lãng phí.\r\n\r\nPhó Thủ tướng lưu ý, kể cả sau khi tỉnh Hải Dương đã hết dịch thì vẫn phải sẵn sàng cũng như các địa phương khác trong cả nước. Bởi vì với 100 triệu dân, đường biên giới rất dài, nền kinh tế mở, chúng ta vẫn phải đón chuyên gia nước ngoài vào phục vụ phát triển kinh tế - xã hội thì “không ai có thể nói Việt Nam tuyệt đối không có mầm bệnh trong cộng đồng. Lúc nào chúng ta cũng phải sẵn sàng\".\r\n\r\n\"Chống dịch bao giờ cũng phải khẩn trương nhất, quyết liệt nhất, đồng bộ nhất. Luôn luôn như vậy. Chúng ta thường nghe ví von \'thời gian vàng\' là 3 ngày, 5 ngày hay 7 ngày... Nhưng phải hiểu mỗi giờ, mỗi phút đều là vàng\", Phó Thủ tướng lưu ý.','d84adc37819955c94a258bc4b0d104be.mp3','2021-02-24 04:00:15','2021-02-24 04:54:07'),(35,'DS Phòng BPD','Sau đây là Danh sách nhân viên phòng Kinh doanh và Dự án tính đến cuối năm 2020:\r\nNguyễn Minh Bằng,\r\nTrần Đình Cường,\r\nNguyễn Văn Duật,\r\nNguyễn Xuân Lượng,\r\nTrịnh Việt Tiến,\r\nNguyễn Quý Minh,\r\nPhạm Công Văn,\r\nNguyễn Hữu Tuấn,\r\nHoàng Thu Minh,\r\nVũ Trung Hiếu,\r\nTrần Thị Thúy Hà,\r\nHà Danh Chung,\r\nNguyễn Khắc Khánh,\r\nVũ Thị Thanh,\r\nĐặng Ngọc Khánh,\r\nMa Đình Nghiêm,\r\nVõ Hồng Hà,\r\nNguyễn Thức Kiên,\r\nBùi Duy Khánh,\r\nVũ Chí Linh,\r\nNguyễn Đình Trung,\r\nLê Văn Kiên,\r\nNguyễn Thị Hạnh Dung,\r\nLê Thị Kim Dung,','7f2653c8473aa3fd0ea7241663d41f86.mp3','2021-02-24 05:19:55','2021-02-24 05:21:49'),(36,'Giới thiệu TTTM','Các lợi ích mà truyền thanh thông minh mang đến:\r\n1.Không dây, rất mỹ quan, chất lượng âm thanh cực tốt.\r\n2. Không bị chèn sóng, nhiễu sóng.\r\n3.Thu âm, phát thanh Mọi lúc, Mọi nơi tới từng cụm loa.\r\n4. Phân cấp Tỉnh, TP/ Quận, Huyện/ Phường-Xã, Buôn Bản/Tổ-Xóm.\r\n5. Phát thanh ghi âm trực tiếp/ Sử dụng file audio có sẵn/ Tiếp sóng.\r\n6. Huỷ tin đang phát; Phát tin khẩn cấp.\r\n7. Phát bản tin theo lịch (cảnh báo giờ trùng nhau), giảm chi phí nhân công, tiết kiệm thời gian.\r\n8. Kiểm soát thông tin từ các cấp có thẩm quyền.\r\n9. Bảo mật (công nghệ mã hóa nội dung, kiểm soát thiết bị, v.v.).','090a63f093f31c4624e8c34b9c919f38.mp3','2021-02-24 07:59:30','2021-02-24 07:59:42'),(37,'Thoi tiet thang 3/2021','Không khí lạnh được dự báo vẫn sẽ hoạt động và ảnh hưởng đến thời tiết miền Bắc trong những tháng đầu năm 2021.\r\nTheo Trung tâm Dự báo khí tượng thủy văn Quốc gia, từ nay đến khoảng tháng 3/2021, hiện tượng La Nina (pha lạnh) còn duy trì với xác suất khoảng 95%, sau đó có xu hướng giảm dần và có khả năng chuyển dần sang trạng thái trung tính ENSO vào mùa hè năm 2021.\r\nTrong tháng 2/2021, Bắc Bộ và các tỉnh Bắc Trung Bộ chịu tác động của không khí lạnh yếu và lệch Đông nên thời tiết phổ biến trời nhiều mây và có sương mù vào đêm và sáng, trưa chiều trời nắng.\r\nNhiệt độ tháng 2 ở khu vực Bắc Bộ và Thanh Hóa-Thừa Thiên Huế phổ biến thấp hơn so với trung bình nhiều năm (TBNN) cùng thời kỳ khoảng 0,5 độ C. Rét đậm, rét hại còn có khả năng xảy ra trong nửa cuối tháng 2/2021, nhưng không kéo dài và chủ yếu xảy ra ở vùng núi phía bắc.\r\nKhoảng từ ngày 26-27/2, phía Đông Bắc Bộ và khu vực Bắc Trung Bộ có khả năng hình thành rãnh áp thấp có trục khoảng 24-26 độ vĩ Bắc bị không khí lạnh nén nên xuất hiện mưa nhỏ rải rác, sau đó trời nhiều mây, ẩm hơn. Kiểu thời tiết ở miền Bắc chia làm 2: phía Tây Bắc khô, ít mưa và nắng ấm; còn phía Đông Bắc ban ngày chủ yếu là sương mù, nồm ẩm, trời rét. Miền Trung có lúc xen lẫn nắng ráo.\r\nSang tháng 3/2021, nhiệt độ trung bình trên cả nước phổ biến xấp xỉ TBNN cùng thời kỳ. Từ tháng 4-8/2021 nhiệt độ trên cả nước phổ biến ở mức xấp xỉ TBNN cùng thời kỳ.\r\nĐề phòng các đợt mưa trái mùa ở khu vực Nam Bộ trong nửa cuối tháng 2/2021. Trong các tháng chuyển mùa (tháng 4-6/2021) khả năng cao sẽ xuất hiện các hiện tượng thời tiết nguy hiểm như dông, sét, lốc, mưa đá trên phạm vi toàn quốc. \r\nNắng nóng tại khu vực Bắc Bộ và Trung Bộ có xu hướng xuất hiện tương đương so với TBNN nhưng không gay gắt và kéo dài như năm 2020.\r\nTrên biển, từ nay đến khoảng tháng 5/2021 ít có khả năng xuất hiện bão và áp thấp nhiệt đới (ATNĐ) trên Biển Đông. Sang tháng 6-7/2021 bão và ATNĐ có khả năng bắt đầu hoạt động ở vùng biển phía Bắc Biển Đông. Đề phòng các cơn bão mạnh, có hướng di chuyển phức tạp và gây gió mạnh trên biển trong các tháng mùa mưa bão năm 2021.','a2efd179ead55a58d783d67a5c685e7b.mp3','2021-02-24 08:10:11','2021-02-24 08:11:19'),(38,'Thơ: Em bảo anh đi đi','Đây là chương trình phát thanh cuối ngày của Truyền thanh thông minh Vi Ne Cô. Xin gửi đến tất cả mọi người một tác phẩm thơ tình\r\nrất hay của Nhà thơ Puskin. Mời mọi người cùng lắng nghe:\r\n\r\nEm bảo: \"Anh đi đi!\r\n\"Sao anh không đứng lại?\r\nEm bảo: \"Anh đừng đợi\"!\r\nSao anh vội về ngay?\r\n\r\nLời nói, thoảng gió bay.\r\nĐôi mắt huyền, đẫm lệ.\r\nMà sao, anh dại thế!\r\nKhông nhìn vào mắt em?\r\n\r\nMà sao, anh dại thế!\r\nKhông nhìn, vào mắt em?\r\nKhông nhìn, vào mắt sầu?\r\nKhông nhìn, vào mắt sâu?\r\n\r\nNhững chuyện buồn, qua đi.\r\nXin anh, không nhắc lại!\r\nEm ngu khờ, vụng dại.\r\nAnh mơ mộng, viễn vông.\r\n\r\nĐời sống nghiệt ngã không.\r\nCho chúng mình, ấm mộng.\r\nThì thôi, xin gửi sóng.\r\nĐưa tình, về cuối sông.\r\n\r\nThì thôi, xin gửi sóng.\r\nĐưa tình, về cuối sông.\r\nĐưa tình, về với mộng.\r\nĐưa tÌnh, vào cõi không.','7a0d6ee6dc2e9e0e4e63a63388f61033.mp3','2021-02-24 08:26:08','2021-02-24 08:47:42'),(39,'ban tin','Hải Dương sẽ tiêm vaccine Covid-19 như thế nào?\r\nKhoảng 33.000 liều vaccine Covid-19 sẽ được tỉnh Hải Dương tiêm cho 9 nhóm thuộc lực lượng tuyến đầu phòng, chống dịch.\r\n\r\nBốn địa điểm đầu tiên được triển khai tiêm vaccine Covid-19 trên cả nước vào sáng 8/3 là Trung tâm y tế huyện Kim Thành; Bệnh viện Bệnh Nhiệt đới tỉnh Hải Dương; Bệnh viện Bệnh Nhiệt đới Trung ương cơ sở 2, huyện Đông Anh (TP Hà Nội) và Bệnh viện Bệnh Nhiệt đới TP HCM.','72cb9597a09c95f196afdc5abf5d489b.mp3','2021-03-08 03:31:19','2021-03-08 03:31:30'),(40,'thông báo phòng dịch bệnh','Hiện nay do tình hình dịch phức tạp đề nghị dười dân chấp hành các lệnh sau:  nghiêm cấp tụ cập nơi đông dười, rửa tay thường xuyên, đeo khẩu khi đi ra ngoài.','6af7402e30afa4528cabab6697e3d29e.mp3','2021-03-15 07:19:03','2021-03-15 07:19:41');
